import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import {
  Banner1,
  Banner2,
  Banner3,
  Banner4,
  Banner5,
  GameIcon,
  ListrikIcon,
  MusikIcon,
  PaketDataIcon,
  PBBIcon,
  PDAMIcon,
  PGNIcon,
  PulsaIcon,
  QurbanIcon,
  TevelisiIcon,
  VoucherMakananIcon,
  ZakatIcon,
} from "../assets/icon";
import { HomeIcons, Header, InfoUserSaldo } from "../components";

function HomePage() {
  const [state, setState] = useState([])

