    }
  })
  return (
    <div className="container-fluid vh-100">
      <Header />
      <div className="container mt-5">
        <InfoUserSaldo />
        <div className="d-flex justify-content-between mt-5">
          <HomeIcons icons={PBBIcon} alt="PBB" textIcon="PBB" />
          <HomeIcons icons={ListrikIcon} alt="Listrik" textIcon="Listrik" />
          <HomeIcons icons={PulsaIcon} alt="Pulsa" textIcon="Pulsa" />
          <HomeIcons icons={PDAMIcon} alt="PDAM" textIcon="PDAM" />
          <HomeIcons icons={PGNIcon} alt="PGN" textIcon="PGN" />
          <HomeIcons
            icons={TevelisiIcon}
            alt="Langganan Televisi"
            textIcon="TV Langganan"
          />
          <HomeIcons icons={MusikIcon} alt="Musik" textIcon="Musik" />
          <HomeIcons
            icons={GameIcon}
            alt="Voucher Game"
            textIcon="Voucher Game"
          />
          <HomeIcons
            icons={VoucherMakananIcon}
            alt="Voucher Makanan"
            textIcon="Voucher Makanan"
          />
          <HomeIcons icons={QurbanIcon} alt="Qurban" textIcon="Qurban" />
          <HomeIcons icons={ZakatIcon} alt="Zakat" textIcon="Zakat" />
          <HomeIcons
            icons={PaketDataIcon}
            alt="Paket Data"
            textIcon="Paket Data"
          />
        </div>
        <div
          className="container-fluid p-0 my-3"
          style={{ overflow: "hidden" }}
        >
          <h6 className="h6 mb-4">Temukan Promo Menarik</h6>
          <div
            className="d-flex gap-4 custom-scroll"
            style={{ overflowX: "auto", whiteSpace: "nowrap", padding: 8 }}
          >
            <img src={Banner1} className="img-fluid" alt="Banner Promo 1" />
            <img src={Banner2} className="img-fluid" alt="Banner Promo 2" />
            <img src={Banner3} className="img-fluid" alt="Banner Promo 3" />
            <img src={Banner4} className="img-fluid" alt="Banner Promo 4" />
            <img src={Banner5} className="img-fluid" alt="Banner Promo 5" />
          </div>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
